import React, { useState, useEffect } from "react";
import {Button, Container, Form} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import axios from 'axios';
import { Link, useParams } from 'react-router-dom';

const Patient = () => {
    const [patients, setPatients] = useState([]);
    
    const {pesel} = useParams();
  useEffect(() => {
      fetchPatient();
    }, []);
  const fetchPatient = () => { 
      axios
        .get(
        //   `http://127.0.0.1:8000/api/patients/?pesel=${match.params.pesel}/`
        `http://127.0.0.1:8000/api/patients/${pesel}`
        )
        .then((res) => {
          setPatients(res.data);
        //   console.log(res.data);
        })
        .catch((err) => console.log(err));
    };
    const propertyVals = Object.keys(patients);
    console.log(propertyVals);

        {propertyVals.map((patients) => {
        return (
          <div className='product-container' key={patients.pesel}>
            
            <div>
              <h1 className='brand'>{patients.name}</h1>
              <h2>{patients.surname}</h2>
            </div>
          </div>
        );
      })}

  };
  export default Patient;
